export default {
  data: function data() {
    return {
      ruleForm: {
        username: 'admin',
        password: '123456'
      },
      rules: {
        username: [{
          required: true,
          message: '请输入用户名',
          trigger: 'blur'
        }],
        password: [{
          required: true,
          message: '请输入密码',
          trigger: 'blur'
        }]
      }
    };
  },
  methods: {
    submitForm: function submitForm(formName) {
      var _this = this;

      this.$refs[formName].validate(function (valid) {
        if (valid) {
          _this.$axios.post("/index.php/Welcome/check_userlist", _this.qs.stringify({
            'name': _this.ruleForm.username,
            'pass': _this.ruleForm.password
          })).then(function (res) {
            var status = res.status;

            if (status === 200) {
              localStorage.setItem('ms_username', this.ruleForm.username);
              this.$router.push('/');
              return true;
            } else {
              console.log('Other error');
              return false;
            }
          }.bind(_this)).catch(function (error) {
            console.log(error.response);
            alert("Failed to login");
          }.bind(_this));
        } else {
          console.log('error submit');
          return false;
        }
      });
    }
  }
};
